create table product
(
    id     serial  not null
        constraint product_pkey
            primary key,
    name   varchar(300),
    mark   varchar(300),
    active integer,
    price  varchar(10),
    info   varchar(3000),
    image  bytea,
    cat_id integer not null
        constraint product_cat_id_fkey
            references category
            on delete cascade,
    cpf    varchar(300)
);

alter table product
    owner to rgyxqnrswarutq;

